    <div className="curly-hair-products">
      <Products
        navigateTo={navigateTo}
        productsData={curlyHairProducts.map((id) => ({
          ...productsData.find((product) => product.id === id),
          id: id // Override the ID to match the current array index
        }))}
      />
    </div>
  );
};

export default CurlyHairProducts;
